import React, {useEffect} from 'react';
import { usePoll } from '../poller/poller'
import './task.css'
export const TaskCard = () =>{

  let mouseX, mouseY = 0
  let mousePositionX , mousePositionY = 0

  window.addEventListener('mousedown',(e) => {
    mouseX =e.clientX
    mouseY= e.clientY
    const largeImage = document.getElementById("largeImage")
    const x= largeImage.offsetLeft  - mouseX
    const y = largeImage .offsetTop  - mouseY
    console.log('mousePos', mousePositionX, mousePositionY)
    largeImage.style.left = `${String((mousePositionX + x))}px`;
    largeImage.style.top  = `${String((mousePositionY + y))}px`;
  })
  window.addEventListener('mousemove', function(event) {
    console.log('move')
    mousePositionX = event.clientX;
    mousePositionY = event.clientY;
  })



  const enlargeImage = (e) => {
    const target = e.target
    const largeImage = document.getElementById("largeImage")
    largeImage.style.position = 'absolute'
    const image = document.createElement("img")
    image.src = target.src
    image.style.width = '400px'
    image.style.height = '400px'
    largeImage.style.display = 'block'

    if(largeImage.children.length < 2) {
      largeImage.append(image)
    }

  }

  const closeImage = () => {
    const largeImage = document.getElementById("largeImage")
    largeImage.style.display = "none"
  }

  const mockData = {assignedTask:[{
      id : "blah",
      image: ""
    },
      {
        id : "blah",
        image: ""
      }
    ], unassignedTask : [{
      id : "blah",
    },
      {
        id : "blah",
      },


    ]}

  // let { data }  = usePoll('/task', 1000)
  const  { assignedTask   , unassignedTask } = mockData
  return (
    <div>
      <table>
        <tr>
          <th>Unassigned</th>
          <th>Assinged</th>
          <th>Done</th>
        </tr>
        <tr>
          <td>
            {unassignedTask ? unassignedTask.map(({title, description, image, state, assignee }) => {
              const imageSrc = `data:image/png;base64,${image}`
              return (
                <div className={"container"}>
                  <p> <span  className={"Title"}>Title:</span>  {`${title}`}</p>
                  <p> <span  className={"Title"}>Description:</span>   {`${description}`}</p>
                  <p> <span  className={"Title"}>State: </span>   {`${state}`}</p>
                  <p> <span  className={"Title"}>Assignee: </span>   {`${assignee}`}</p>
                  <div className={'imageContainer'}>
                    <img src={imageSrc}></img>
                  </div>
                </div>
              )
            }): "loading..."}
          </td>
          <td>
            {assignedTask ? assignedTask.map(({title, description, state, assignee, image }) => {
              const imageSrc = `data:image/png;base64,${image}`
              return (
                <div className={"containerAssigned"}>
                  <p> <span className={"Title"}>Title:</span>  {`${title}`}</p>
                  <p> <span  className={"Title"} >Description:</span>  {`${description}`}</p>
                  <p> <span  className={"Title"} >State: </span>  {`${state}`}</p>
                  <p> <span  className={"Title"}>Assignee:</span>  {`${assignee}`}</p>
                  <div className={'imageContainer'}>
                    <img onClick={enlargeImage} className={"smallImage"} src={imageSrc}></img>
                  </div>
                </div>
              )
            }): "loading.."}

          </td>
        </tr>
      </table>
      <div id="largeImage" className={'imageModel'} >
        <button id="imageCloseButton" onClick={closeImage}>close Image </button>
      </div>

    </div>

  )

}
